                mConfidence[i] += confidenceAmount;
                if (mConfidence[i] >= 1.0f) {
                    mConfidence[i] = 1.0f;
                    if (i != mRotation) {
                        if (log) {
                            Slog.v(TAG, "Orientation changed!  rotation=" + i);
                        }
