    if (mDeviceProperties.isInCache(address) && getRemoteUuids(address) != null) {
        String path = getObjectPathFromAddress(address);
        if (path == null)
            return false;
        // Use an empty string for the UUID pattern
        ret = discoverServicesNative(path, "");
