    synchronized (mStartLock) {
        if (!mStarted) {
            return ERROR;
        }
        try {
            mITts.addEarcon(mPackageName, earcon, packagename, resourceId);
            return SUCCESS;
        } catch (RemoteException e) {
            // TTS died; restart it.
            Log.e("TextToSpeech.java - addEarcon", "RemoteException");
            e.printStackTrace();
            mStarted = false;
            initTts();
        } catch (NullPointerException e) {
            // TTS died; restart it.
            Log.e("TextToSpeech.java - addEarcon", "NullPointerException");
            e.printStackTrace();
            mStarted = false;
            initTts();
        } catch (IllegalStateException e) {
            // TTS died; restart it.
            Log.e("TextToSpeech.java - addEarcon", "IllegalStateException");
            e.printStackTrace();
            mStarted = false;
            initTts();
        }
        return ERROR;
    }
}

