    }
    if (sEglConfig == null) {
        throw new RuntimeException("eglConfig not initialized");
    }
    if (Thread.currentThread() != sEglThread) {
        throw new IllegalStateException("HardwareRenderer cannot be used " + "from multiple threads");
    }
