                mQuery.close();
                mQuery = new SQLiteQuery(db, mQuery);
            } catch (IllegalStateException e) {
                // for backwards compatibility, just return false
                Log.w(TAG, "requery() failed " + e.getMessage(), e);
                return false;
            } finally {
                db.unlock();
