        } else if (where == TruncateAt.END) {
            left = mt.breakText(0, len, true, avail);
        } else {
            right = len - mt.breakText(0, len, false, avail / 2);
            avail -= mt.measure(right, len);
            left = mt.breakText(0, right, true, avail);
        }
