            sb.append(buf, 0, left);
            sb.append(sEllipsis);
            sb.append(buf, right, len - right);
            return sb.toString();
        }
        SpannableStringBuilder ssb = new SpannableStringBuilder();
        ssb.append(text, 0, left);
        ssb.append(sEllipsis);
        ssb.append(text, right, len);
