            return false;
        }
    } else {
        if (!mBluetoothService.disconnectPanDeviceNative(objectPath)) {
            // Restore prev state, this shouldn't happen
            handlePanDeviceStateChange(device, state, panDevice.mLocalRole);
            return false;
        }
    }
    return true;
