                ((Message) msg.obj).sendToTarget();
                break;
            }
        case NEVER_REMEMBER_PASSWORD:
            {
                mDatabase.setUsernamePassword(msg.getData().getString("host"), null, null);
                ((Message) msg.obj).sendToTarget();
                break;
            }
