                    Log.v(LOGTAG, "showRectMsg=(top=" + top + ",height=" + height + ",maxHeight=" + maxHeight + ",viewHeight=" + viewHeight + ",y=" + y + ",yPercentInDoc=" + data.mYPercentInDoc + ",yPercentInView=" + data.mYPercentInView + ")");
