            if (mWebTextView != null) {
                // Clear the WebTextView adapter when AutoFill finishes
                // so that the drop down gets cleared.
                mWebTextView.setAdapterCustom(null);
            }
            break;
        case SELECT_AT:
            nativeSelectAt(msg.arg1, msg.arg2);
            break;
        default:
            super.handleMessage(msg);
            break;
    }
}

